import React from 'react';
// import { useNavigate } from 'react-router-dom';
// import Button from '@mui/material/Button';
import '../SignUp/Signup.scss'; // Import the CSS file
import sideImage from './sideimage.png';

const Signup = () => {
  const handleSubmit = (e) => {
    e.preventDefault();
  };

  return (
    <div className="main">
      <form onSubmit={handleSubmit}>
        <div className="head">

          <h3>Create your Fundoo Account</h3>
        </div>

        <div className="name">
          <input type="text" name="firstName" required />
          <label>First name</label>
        </div>

        <div className="name">
          <input type="text" name="lastName" required />
          <label>Last name</label>
        </div>

        <div className="user-name">
          <input type="text" name="username" required />
          <label>Username</label>
          <span className="gmail">@gmail.com</span>
        </div>

        <p className="line1">You can use letters, numbers & periods</p>
        <a href="/" className="line2">Use my current email address instead</a>

        <div className="pass">
          <input type="password" name="password" className="password" required />
          <label>Password</label>
        </div>

        <div className="pass">
          <input type="password" name="confirmPassword" className="password" required />
          <label>Confirm</label>
        </div>

        <p className="line3">Use 8 or more characters with a mix of letters, numbers & symbols</p>
        <a href="/" className="line4">Sign in instead</a>

        <input type="submit" value="Next" />
      </form>

      <div className="side-image">
        <img src={sideImage} alt="Side visual" className="side-logo" />
      </div>
    </div>
  );
};

export default Signup;
